var theme=null;
function launch() {
	OpenLayers.ProxyHost = "/osa/proxy?url=";
    var configUrl = "/osa/config?config=MetadataConfig";
    options = {};
    oxCfg = new oscar.Control.OXFConfigManager();
    oxCfg.events.on({"haveThemes":loadMetadata});
    oxCfg.load(configUrl);
	
}
function loadMetadata(ox) {
    theme = ox.oxThemes[0];
    openDlg();

}
function openDlg() {
	var ctrl = new oscar.Gui.Metadata('serviceMetadata',theme,{"showUsed":false});
    var dlg = new oscar.Gui.Dialog("MapInformationDlg",{},{draggable:false,modal:true,height:500,width:750,autoclose:false,fixedcenter:true});
    var hdr = oscar.i18n("MapInformationDlgHeader") + ": " + theme.name;
    dlg.setHeader(hdr);
    dlg.setContent(ctrl.getContainer());
    var ctx = this;
    var cb_cb = function() {
        dlg.hide();
    };
    dlg.addCancelButton(cb_cb);
    dlg.show();
}
</script>
